import React from 'react';
import './Contact.css';

const links = [
  {
    link: "mailto:rcdb.orourke@gmail.com?subject=Portfolio enquiry",
    src: "./icons/email.svg",
    alt: "Get in touch by email"
  }, {
    link: "https://www.linkedin.com/in/rachaelcodes/",
    src: "./icons/linkedin.svg",
    alt: "Get in touch through Linked In"
  },
];

function Link(props) {
  return (
    <a href={props.link} className="Contact-link" target="_blank" rel="noopener noreferrer"><img src={props.src} alt={props.alt}></img></a>
  )
}

function Contact() {
  return (
    <section className="Contact">
      <h2>Ask me what I can make for your company</h2>
      <a href="mailto:rcdb.orourke@gmail.com?subject=Portfolio enquiry" className="Contact-link" target="_blank" rel="noopener noreferrer"><p>Get in touch by email</p></a>
      <a href="https://www.linkedin.com/in/rachaelcodes/" className="Contact-link" target="_blank" rel="noopener noreferrer"><p>Get in touch through LinkedIn</p></a>
    </section>
  );
}

export default Contact;
